import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import './style.css';

const links = [
    { route: "/", label: "Home"},
    { route: "/confconta", label: "Configuração da Conta"},
    { route: "/projetos", label: "Projetos"},
    { route: "/conta", label: "Conta"},
    { route: "/criarvideomanual", label: "Criar Video Manual"},
    { route: "/criarvideoautomatic", label: "Criar Video Automatico"},

];

export class Menu extends Component {
    renderLink = () => {
        return links.map( link =>
            <Link key={link.route} className="nav-link" to={link.route}>
                {link.label}
            </Link>
        )
    }

    render() {
        return (
<div>
    <header id="mainheader">
    <nav className="navbar navbar-dark navbar-expand-lg fixed-top bg-white portfolio-navbar gradient">
        <div className="container"><a className="navbar-brand logo" href="/">VMaker {localStorage.getItem('token') != null ? '- LOGADO' : '- NÃO LOGADO' } </a><button data-toggle="collapse" class="navbar-toggler" data-target="#navbarNav"><span class="sr-only">Toggle navigation</span><span class="navbar-toggler-icon"></span></button>
            <div className="collapse navbar-collapse"
                id="navbarNav">
                <ul className="nav navbar-nav ml-auto">
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        { this.renderLink() }
                    </ul>
                </div>
                </ul>
            </div>
        </div>
    </nav>
    </header>
    </div>
           
        )
    }
};

export default Menu;
